//       "description": "Qual perfil n\u00f3s buscamos?\n\nNa Dadosfera os nossos projetos s\u00e3o elaborados de acordo com a necessidade de cada cliente de maneira customizada proporcionando assim o verdadeiro IMPACTO por onde passamos.\n\nPara esta vaga estamos em busca de uma pessoa que seja apaixonada por dados, que goste de trabalhar em um ambiente de alto aprendizado e autonomia, com as melhores tecnologias do mercado, al\u00e9m de (claro!) fazer parte de um time de profissionais feras no que fazem! \u00c9 uma grande oportunidade para aprender com profissionais de refer\u00eancia e atuar em projetos que realmente tratam Big Data!\n\nComo Data Analyst Junior no time de Servi\u00e7os Profissionais, voc\u00ea ir\u00e1 apoiar na constru\u00e7\u00e3o de an\u00e1lise de dados elegantes e otimizados, apoiar no entendimento das demandas de neg\u00f3cio, mapear e documentar processos para an\u00e1lise de dados e manter o acesso aos dados dispon\u00edveis para o neg\u00f3cio.\n\nResponsabilidades e atribui\u00e7\u00f5es\n\nComo ser\u00e1 o seu dia a dia:\n\u2022 Extrair os dados mais relevantes para filtr\u00e1-los e... transform\u00e1-los em insights.\n\u2022 Conduzir estudos preliminares sobre os dados, usar t\u00e9cnicas de data mining, modelagem, conceitos de SQL, empregando todos esses conhecimentos na descoberta de padr\u00f5es.\n\u2022 Garimpar elevada quantidade de dados desestruturados, interpret\u00e1-los e criar estrat\u00e9gias. Atrelado a conhecimento em SQL e estat\u00edstica, capacidade anal\u00edtica com representa\u00e7\u00e3o em gr\u00e1ficos, tabelas e modelos capazes de orientar as tomadas de decis\u00e3o.\n\u2022 Apresentar para os clientes e pessoas interessadas as an\u00e1lises realizadas e os resultados obtidos atrav\u00e9s dos dados.\n\nRequisitos e qualifica\u00e7\u00f5es\n\nO que precisamos que voc\u00ea tenha:\n\u2022 Habilidades em programa\u00e7\u00e3o SQL;\n\u2022 Conhecimento em Python;\n\u2022 Conhecimento de alguma ferramenta de visualiza\u00e7\u00e3o (Metabase, PowerBI, Qlikview, Tableau) ;\n\u2022 Boa comunica\u00e7\u00e3o;\n\u2022 Ingl\u00eas no m\u00ednimo intermedi\u00e1rio.\n\nSer\u00e1 um diferencial se voc\u00ea tiver:\n\u2022 Experi\u00eancia com sistema de controle de vers\u00f5es (Git);\n\u2022 Experi\u00eancia com Sistemas Distribu\u00eddos;\n\u2022 Experi\u00eancia com Cloud Computing, preferencialmente AWS;\n\u2022 Conhecimento te\u00f3rico de conceitos de Data Lake e DW;\n\u2022 Experi\u00eancia com BI.\n\nInforma\u00e7\u00f5es adicionais\n\nQuer saber sobre os nossos benef\u00edcios?\n\u2022 Temos um mega cart\u00e3o de benef\u00edcios flex com v\u00e1rias categorias, refei\u00e7\u00e3o, alimenta\u00e7\u00e3o, mobilidade, sa\u00fade, cultura e educa\u00e7\u00e3o, o nosso Fera Flex!\n\u2022 Plano de sa\u00fade SulAm\u00e9rica com cobertura nacional e acomoda\u00e7\u00e3o em apartamento, sem desconto e sem coparticipa\u00e7\u00e3o;\n\u2022 Seguro de vida;\n\u2022 Gympass;\n\u2022 Licen\u00e7a maternidade/paternidade estendida;\n\u2022 Acesso aos cursos da AcademyDS;\n\u2022 Investimento em Cursos e Certifica\u00e7\u00f5es (Amazon AWS, Google GCP, Microsoft Azure, Snowflake etc.);\n\u2022 Hor\u00e1rio flex\u00edvel (8 horas por dia).\n\nPensa que acabou? Ainda n\u00e3o!\n\u2022 Possibilidade de trabalhar e ter contato com alguns do maiores projetos de engenharia e ci\u00eancias de dados em execu\u00e7\u00e3o no pa\u00eds;\n\u2022 Ser parte ativa da jornada de uma empresa que, de fato, veio para mudar os paradigmas da Engenharia e Analytics.\n\nA Dadosfera se orgulha de:\n\nCelebrar todas as diferen\u00e7as e batalhar diariamente para tornar nosso time cada vez mais inclusivo. N\u00f3s n\u00e3o compactuamos com NENHUMA CONDUTA DISCRIMINAT\u00d3RIA.\n\n\ufeff\n\nE A\u00cd, SE IDENTIFICOU COM A GENTE? ENT\u00c3O CORRE PARA SE INSCREVER\n\nVEM SER #FERA!\n\nNa Dadosfera (anteriormente DataSprints), oportunidades se fazem diariamente. Inovamos e crescemos continuamente por meio de colabora\u00e7\u00e3o, dinamismo e flexibilidade. Valorizamos, encorajamos e apoiamos o que torna as pessoas diferentes: backgrounds, ideias e experi\u00eancias de vida!\n\nContratamos pessoas inteligentes, criativas e apaixonadas que est\u00e3o sempre dispostas a aprender e ensinar com confian\u00e7a, integridade e dedica\u00e7\u00e3o.\n\nSomos movidos por excel\u00eancia e autonomia, potencializados por nossa paix\u00e3o, engajamento e compromisso profundo com entregas.\n\nComemos desafios e dados no caf\u00e9 da manh\u00e3!\n\nNos \u00faltimos 3 anos, conquistamos alguns marcos:\n\nTOP 10 Startup do Brasil pelo Linkedin em 2021\n\nSomos a \u00fanica Parceira #AWS Advanced e Service Delivery Partner com foco em #Data & #Analytics EMR de Minas Gerais (somente duas no Brasil)\n\nAdvanced Consulting Partner e Public Sector Partner #AWS\n\nMicrosoft Azure Gold Data Platform & Gold Data Analytics\n\nEmpresa cidad\u00e3\n\nAprovados no programa pr\u00f3 inova\u00e7\u00e3o do BDMG que atesta nossa governan\u00e7a e estrutura financeira ap\u00f3s receber um selo de aprova\u00e7\u00e3o dessa importante institui\u00e7\u00e3o financeira\n\nTOP 10 empresas brasileiras mais desejadas para se trabalhar com dados pela pesquisa State of Data do Data Hackers e auditada pela Bain & Company Cubo Startup Ita\u00fa 2022\n\nCubo Startup Ita\u00fa 2022\n\nAgora precisamos de voc\u00ea para conquistar marcos exponenciais!\n\nQuer conhecer mais sobre nossa cultura? Descubra sobre nossos famosos 5 \"D\"s\n\nDiversity: \u201cDifferent experiences and backgrounds makes us versatile\u201d\n\nAcreditamos que pessoas com hist\u00f3rias, viv\u00eancias, origens e caminhos diferentes nos completam e somam for\u00e7as para o nosso time, nos fazendo cada vez mais adapt\u00e1veis.\n\nDiligence: \u201cWe do better, faster and accurate\u201d\n\nZelamos pelo nosso time e pelo nosso trabalho, nos comprometemos a fazer da melhor forma, com \u00e9tica e transpar\u00eancia, resultando na entrega do do melhor resultado poss\u00edvel.\n\nDynamism: \u201cWe are fast paced\u201d\n\nEstamos em constante crescimento, aprendizado e aperfei\u00e7oamento. Nosso ritmo por natureza \u00e9 acelerado e estamos sempre em movimento.\n\nDeliver: \u201cWe deliver results that drive success to our customers and to ourselves\u201d\n\nExecutamos projetos efetivamente e com prop\u00f3sito, queremos que nossos clientes sejam impactados pelas nossas entregas e que nosso time seja desenvolvido atrav\u00e9s delas.\n\nData: \u201cWe mean Data-driven\u201d\n\nTransformamos dados em intelig\u00eancia para o desenvolvimento e crescimento de pessoas e neg\u00f3cios. Trabalhamos com as melhores tecnologias e nossas a\u00e7\u00f5es s\u00e3o guiadas por dados.\n\nEsta \u00e9 uma oportunidade para participar da nossa REVOLU\u00c7\u00c3O do mundo de dados com direto impacto nos neg\u00f3cios das organiza\u00e7\u00f5es mais avan\u00e7adas.\n\nVenha ser #Fera",
