//       "description": "Somos Eiters!\n\nBuscamos profissionais apaixonados pelo que fazem.\n\nNesta oportunidade, o profissional atuar\u00e1 de forma remota compondo o time de analistas, respons\u00e1veis pela sustenta\u00e7\u00e3o do Banco de dados Oracle em nossos clientes.\n\nSe voc\u00ea gosta de processos, an\u00e1lise em banco de dados e comunica\u00e7\u00e3o ativa com clientes, venha ser um Eiter!\n\nPrincipais atribui\u00e7\u00f5es do Eiter:\n\nResponder pela administra\u00e7\u00e3o dos bancos de dados, assegurando a seguran\u00e7a, integridade e disponibilidade\nEfetuar coleta de estat\u00edsticas, indicadores e monitoramento dos bancos de dados\nRealizar procedimentos relacionados a backups e planejar estrat\u00e9gia de recupera\u00e7\u00e3o\nPrestar suporte e gerenciar usu\u00e1rios na utiliza\u00e7\u00e3o do banco de dados\nImplantar e documentar rotinas e controlar os n\u00edveis de servi\u00e7o de banco de dados\nDefinir par\u00e2metros de performance de sistemas de banco de dados\nRealizar a instala\u00e7\u00e3o do software de banco de dados\n\nREQUISITOS E QUALIFICA\u00c7\u00d5ES\n\nConhecimento das tecnologias e ferramentas do banco... Oracle\nConhecimento em an\u00e1lise de performance e identificar ofensores\nConhecimento em reindexa\u00e7\u00e3o de banco\nGest\u00e3o de banco de dados em ambiente Cloud\n\nINFORMA\u00c7\u00d5ES ADICIONAIS\n\nNossos benef\u00edcios promovem bem estar e cuidado com o nosso colaborador. Para n\u00f3s, \u00e9 importante te ver bem!\n\nPlano de sa\u00fade Amil Nacional (sem custo de mensalidade e coparticipa\u00e7\u00e3o para o colaborador);\nPlano odontol\u00f3gico Uniodonto nacional (sem custo de mensalidade e coparticipa\u00e7\u00e3o para o colaborador);\nVale transporte;\nVale refei\u00e7\u00e3o e/ou vale alimenta\u00e7\u00e3o;\nSeguro de vida (totalmente pago pela empresa);\n\nE tem mais...\n\nIncentivo a treinamento;\nInvestimento em certifica\u00e7\u00e3o;\nPlano de carreira;\nPr\u00eamio por indica\u00e7\u00e3o;\nConv\u00eanio com SESC",
