//       "description": "Dados. Tecnologia. Fibra. Somos a Oi, somos milhares de colaboradores desafiados a mudar, agilizar e transformar esta companhia e tudo o que ela faz.\n\nQual ser\u00e1 seu desafio aqui?\n\u2022 Colaborar com um time de estat\u00edsticos, engenheiros em machine learning, data engineer e \u00e1reas de neg\u00f3cios para desenvolver solu\u00e7\u00f5es e resolver problemas usando Data Science;\n\nResponsabilidades e atribui\u00e7\u00f5es\n\nComo ser\u00e1 o seu dia-a-dia?\n\u2022 Atuar na cria\u00e7\u00e3o, desenvolvimento e melhoria interativa de solu\u00e7\u00f5es de aprendizado de m\u00e1quina que potencialize o neg\u00f3cio;\n\u2022 Trabalhar em conjunto com engenheiro de dados e arquitetos de dados na cria\u00e7\u00e3o de Datasets, no formato necess\u00e1rio para treinamento de m\u00faltiplos modelos.\n\u2022 Realizar an\u00e1lises descritivas e explorat\u00f3rias, modelagem preditiva, aplicar aprendizado de m\u00e1quina, realizar simula\u00e7\u00f5es, an\u00e1lise de texto e visualiza\u00e7\u00e3o interativa de dados.\n\u2022 Auxiliar na expans\u00e3o do uso da ci\u00eancia de dados nas frentes de neg\u00f3cios: participar de reuni\u00f5es com clientes (principalmente... internos), auxiliar estruturando projetos e projetando solu\u00e7\u00f5es com base nas necessidades e problemas a serem resolvidos.\n\u2022 Comunicar com clareza os resultados por meio de apresenta\u00e7\u00f5es e relat\u00f3rios para clientes;\n\u2022 Liderar projetos, realizar levantamento de necessidades e propor solu\u00e7\u00f5es\n\u2022 Aplicar an\u00e1lises: Machine Learning e Intelig\u00eancia Artificial para buscar solu\u00e7\u00f5es para os desafios de neg\u00f3cios;\n\u2022 Cria\u00e7\u00e3o de modelos estat\u00edsticos avan\u00e7ados com uso de IA (\u00e1rvore de decis\u00e3o, algoritmos de regress\u00e3o, algoritmo de agrupamentos e etc. )\n\u2022 Constru\u00e7\u00e3o de modelos preditivos, sistemas de recomenda\u00e7\u00e3o, NLP (PNL) , Computer Vision;\n\u2022 Empregar as m\u00e9tricas Acur\u00e1cia, Precis\u00e3o, Recall, ROC Curve (etc) quando necess\u00e1rio.\n\u2022 Criar visualiza\u00e7\u00f5es de dados para explicar suas an\u00e1lises e conclus\u00f5es para uma audi\u00eancia n\u00e3o-t\u00e9cnica, assim como contextualizar a narrativa (data storytelling);\n\nRequisitos e qualifica\u00e7\u00f5es\n\nQuais conhecimentos que n\u00e3o podem faltar?\n\u2022 Curso superior completo ou em andamento em estat\u00edstica, matem\u00e1tica, engenharias; ci\u00eancia da computa\u00e7\u00e3o ou correlatas;\n\u2022 M\u00ednimo de dois anos de experi\u00eancia em linguagem de programa\u00e7\u00e3o como R, Python, ferramentas de Data Science;\n\u2022 Cursos e certifica\u00e7\u00f5es em Data Science;\n\u2022 Experi\u00eancia em Modelagem Geral e conhecimentos em Ci\u00eancia de dados;\n\u2022 Conhecer ferramentas de estat\u00edstica; linguagem de programa\u00e7\u00e3o (Python, Scala, \u201cR\u201d) ou ferramenta de data Science;\n\u2022 Conhecimento em visualiza\u00e7\u00e3o de dados, machine learning, deep learning, reconhecimento de padr\u00f5es e prepara\u00e7\u00e3o de dados;\n\u2022 Tenha viv\u00eancia em aplica\u00e7\u00f5es de t\u00e9cnicas de Analytics avan\u00e7ado e desenvolvimento de algoritmos e c\u00f3digos voltados para aplica\u00e7\u00f5es de neg\u00f3cio;\n\u2022 S\u00f3lida compreens\u00e3o de estat\u00edstica, incluindo testes e distribui\u00e7\u00f5es;\n\u2022 Conhecimentos de NLP (Regular Expressions, POS tagging, Word Embedding, Named-Entity Recognition).\n\u2022 Aplica\u00e7\u00e3o e cria\u00e7\u00e3o de modelos de Time series;\n\u2022 Experi\u00eancia de desenvolvimento em metodologia \u00c1gil;\n\u2022 Capacidade de explicar suas solu\u00e7\u00f5es de maneira clara e simples para todas as \u00e1reas internas\n\nHabilidades que aumentam as suas chances:\n\u2022 Conhecimento em sistemas distribu\u00eddos (Elastic Search).\n\u2022 Conhecimento funcional e experi\u00eancia em implementa\u00e7\u00e3o de m\u00f3dulos ou aplica\u00e7\u00f5es relativas a plataforma Salesforce;\n\u2022 Participa\u00e7\u00e3o em projetos para fornecimento de dados em \u201creal time\u201d;\n\u2022 Sentir-se dono;\n\u2022 Reagir a problemas e desafios de forma colaborativa;\n\u2022 Ser proativo;\n\u2022 Buscar a excel\u00eancia;\n\u2022 Comunicar-se de forma fluida e parceira.\n\nInforma\u00e7\u00f5es adicionais\n\nBenef\u00edcios\n\n# Programa de Participa\u00e7\u00e3o nos Resultados\n\n# Home Office e hor\u00e1rios flex\u00edveis\n\n# Vale-transporte\n\n# Plano de Sa\u00fade\n\n# Plano Odontol\u00f3gico\n\n# Desconto em Medica\u00e7\u00e3o\n\n# Seguro de Vida\n\n# Ticket Refei\u00e7\u00e3o ou Alimenta\u00e7\u00e3o\n\n# Universidade Oi Educa\n\n# Clube de Descontos\n\n# Aux\u00edlio-Creche\n\n# Dress Code Casual\n\nOnde voc\u00ea ir\u00e1 trabalhar com a gente ?\n\u2022 Trabalho 100% Home Office.\n\nNossa miss\u00e3o \u00e9 criar novos futuros, levando a vida digital para todos. Por isso a inova\u00e7\u00e3o e a criatividade s\u00e3o as principais aliadas para promover experi\u00eancias que melhorem a vida de pessoas e empresas em todo pa\u00eds. Se voc\u00ea gosta de pensar em solu\u00e7\u00f5es transformadoras e experi\u00eancias \u00fanicas, e tem muita fibra para fazer acontecer, vem com a gente!\n\ntransforma\u00e7\u00e3o\n\nA Oi est\u00e1 mudando para ser a maior empresa de fibra \u00f3tica do brasil e desenvolver uma plataforma de servi\u00e7os digitais. Vem com a gente pensar novos futuros e facilitar a vida das pessoas. Vem se transformar com a gente!\n\ngente de fibra\n\nA Oi \u00e9 feita de gente com garra, muita energia, disposi\u00e7\u00e3o e versatilidade. Mas principalmente gente com fibra para encarar desafios, buscar a supera\u00e7\u00e3o e fazer acontecer. Aqui dentro a gente se reinventa e, diante dos obst\u00e1culos, n\u00f3s sempre mostramos a nossa for\u00e7a.\n\ndiversidade nos conecta\n\nAqui nos respeitamos e nos sentimos livres para ser quem somos. Oferecemos um ambiente de trabalho plural, inclusivo e colaborativo, onde as pessoas podem ser aut\u00eanticas e viver boas experi\u00eancias. Criamos conex\u00f5es que valorizam as diferen\u00e7as.\n\naprender todo dia\n\nTemos o desafio di\u00e1rio de buscar solu\u00e7\u00f5es acess\u00edveis para problemas complexos. Acreditamos que o desenvolvimento cont\u00ednuo do nosso time estimula a transforma\u00e7\u00e3o do neg\u00f3cio. Por isso quem est\u00e1 na Oi, n\u00e3o para de aprender.\n\ncriar o futuro agora\n\nAcreditamos que a tecnologia cria novos futuros. Por isso, levar a vida digital para dentro da casa e dos neg\u00f3cios faz parte do nosso prop\u00f3sito. Transformar a vida das pessoas faz parte da nossa ambi\u00e7\u00e3o",
