//       "description": "Overview\n\nResponsabilidades e atribui\u00e7\u00f5es\nComo Analista de BI de Customer Success, voc\u00ea ser\u00e1 respons\u00e1vel por:\n\n\u2022 Gerar indicadores de desempenho das escolas parceiras;\n\n\u2022 Criar relat\u00f3rios automatizados no Power BI para auxiliar a \u00e1rea na tomada de decis\u00e3o;\n\n\u2022 Apresentar resultados, gerando insights e garantindo que as tomadas de decis\u00e3o da equipe sejam baseadas em dados;\n\n\u2022 Automatizar processos para tornar a opera\u00e7\u00e3o mais escal\u00e1vel.\n\nRequisitos e qualifica\u00e7\u00f5es\nO que preciso ter para me candidatar a essa vaga?\n\n\u2022 Ensino superior em administra\u00e7\u00e3o, engenharia, economia e \u00e1reas afins.\n\n\u2022 Excel avan\u00e7ado;\n\n\u2022 Power BI (modelagem de dados, cria\u00e7\u00e3o de p\u00e1ginas e reports, storytelling... publica\u00e7\u00e3o e divulga\u00e7\u00e3o de relat\u00f3rios);\n\n\u2022 Perfil anal\u00edtico.\n\nO que \u00e9 um diferencial para esta vaga?\n\n\u2022 Experi\u00eancia pr\u00e9via na \u00e1rea de indicadores;\n\n\u2022 Familiaridade com as ferramentas Google;\n\n\u2022 Familiaridade com SQL.\n\nInforma\u00e7\u00f5es adicionais:\nO que temos a oferecer?\n\n\u2022 VT \u2013 Vale transporte\n\n\u2022 Plano de sa\u00fade\n\n\u2022... Plano odontol\u00f3gico\n\n\u2022 Vale refei\u00e7\u00e3o/alimenta\u00e7\u00e3o como saldo livre no cart\u00e3o CAJU\n\n\u2022 Edify Online \u2013 plataforma de ensino de ingl\u00eas cont\u00ednuo\n\n\u2022 Day off de anivers\u00e1rio\n\n\u2022 Aux\u00edlio Creche ou Bab\u00e1\n\n\u2022 Licen\u00e7a maternidade estendida (6 meses)\n\n\u2022 Licen\u00e7a paternidade estendida (20 dias)\n\n\u2022 Seguro de vida\n\n\u2022 PLR\n\n\u2022 Flexibilidade\n\n\u2022 E o principal: desafios de verdade\n\nSomos uma EdTech que nasceu com o objetivo de construir novas formas de aprender e ensinar.\nVivemos em um mundo globalizado, cada vez mais integrado e, por isso, acreditamos no bilinguismo como forma de inclus\u00e3o, seja atrav\u00e9s do ensino ingl\u00eas e/ou de programa\u00e7\u00e3o.\n\nAtuamos em diversas escolas ao redor do Brasil, impactando mais de 60 mil alunos com nossas solu\u00e7\u00f5es, e seguimos crescendo em ritmo acelerado.\n\nEstamos em busca de pessoas apaixonadas pelo nosso prop\u00f3sito e que queiram trabalhar em um ambiente informal, colaborativo e focado em resultados, onde \u00e9 incentivada a flexibilidade e autonomia.\nCaso queira conhecer mais, voc\u00ea tamb\u00e9m pode acompanhar nossos artigos por aqui:\n\nSe identificou? Ent\u00e3o d\u00ea uma olhada em nossas vagas e venha trabalhar com a gente\n#weonlyedifytogether",
