//       "description": "Somos uma seguradora mineira e temos em nosso DNA a busca constante por inova\u00e7\u00e3o, com a experie\u0302ncia e o profissionalismo de uma marca consolidada no mercado ha\u0301 mais de 10 anos e li\u0301der no segmento de Seguro Garantia. Para garantir a melhor experie\u0302ncia aos nossos clientes, com qualidade, excele\u0302ncia e de forma a\u0301gil, investimos em pessoas e em tecnologia.\n\nSempre antenados aos movimentos do mercado, abrac\u0327amos a transformac\u0327a\u0303o digital, ideias inovadoras e movimentos disruptivos.\n\nFa\u00e7a parte da transforma\u00e7\u00e3o do mercado de seguros!#Timecampe\u00e3o\n\nResponsabilidades e atribui\u00e7\u00f5es\n\u2022 Acompanhar periodicamente os indicadores de produ\u00e7\u00e3o e resultados dos produtos (Sinistralidade, renova\u00e7\u00e3o, inadimpl\u00eancia, regi\u00e3o, canais; etc) visando orientar as \u00e1reas de subscri\u00e7\u00e3o e produto na elabora\u00e7\u00e3o de suas estrat\u00e9gias de atua\u00e7\u00e3o;\n\u2022 Analisar e validar bases de dados necess\u00e1rias para desenvolvimento de modelos de precifica\u00e7\u00e3o e subscri\u00e7\u00e3o autom\u00e1ticos visando a utiliza\u00e7\u00e3o de informa\u00e7\u00f5es consistentes, que... tenham correspond\u00eancia cont\u00e1bil e que reflitam a realidade dos produtos;\n\u2022 Liderar a realiza\u00e7\u00e3o de pesquisas de mercado sobre pre\u00e7os de seguro de cong\u00eaneres quando necess\u00e1rio visando a utiliza\u00e7\u00e3o dos resultados como inputs para modelos de precifica\u00e7\u00e3o iniciais, onde a Pottencial n\u00e3o tenha experi\u00eancia suficiente para modelo pr\u00f3prio;\n\u2022 Garantir o envolvimento das \u00e1reas de subscri\u00e7\u00e3o e produto no desenvolvimento de modelos de precifica\u00e7\u00e3o e/ou subscri\u00e7\u00e3o automatizados visando a elabora\u00e7\u00e3o de modelos adequados \u00e0 realidade dos produtos;\n\u2022 Desenvolver modelos de precifica\u00e7\u00e3o e/ou subscri\u00e7\u00e3o automatizados visando a utiliza\u00e7\u00e3o em opera\u00e7\u00f5es massificadas e otimiza\u00e7\u00e3o dos modelos adotados pela Pottencial;\n\u2022 Acompanhar a performance dos modelos de precifica\u00e7\u00e3o e/ou subscri\u00e7\u00e3o automatizados visando a identifica\u00e7\u00e3o da necessidade de ajustes aos modelos adotados;\n\u2022 Elaborar a Nota T\u00e9cnica Atuarial conforme modelo de precifica\u00e7\u00e3o e demais informa\u00e7\u00f5es necess\u00e1rias visando garantir a adequa\u00e7\u00e3o das taxas praticadas em rela\u00e7\u00e3o ao n\u00edvel de resultados esperados para determinado produto;\n\u2022 Acompanhar a adequa\u00e7\u00e3o das taxas praticadas pelo produto em rela\u00e7\u00e3o ao disposto na Nota T\u00e9cnica Atuarial visando a revis\u00e3o, se necess\u00e1rio, do n\u00edvel de taxas praticadas pelo produto.\n\nRequisitos e qualifica\u00e7\u00f5es\n\u2022 Ensino superior em Estat\u00edstica, Ci\u00eancias Atuariais, Engenharia de Produ\u00e7\u00e3o e/ou \u00e1reas afins;\n\u2022 Experi\u00eancia acima de 2 anos;\n\u2022 Necess\u00e1rio conhecimento em Modelagem Estat\u00edstica;\n\u2022 Necess\u00e1rio conhecimento em Python;\n\u2022 Necess\u00e1rio conhecimento em Power BI;\n\u2022 Necess\u00e1rio experi\u00eancia com an\u00e1lise de dados;\n\u2022 Desej\u00e1vel conhecimento da \u00e1rea de Seguros;\n\u2022 Desej\u00e1vel conhecimento em SQL.\n\nInforma\u00e7\u00f5es adicionais\n\nBenef\u00edcios:\n\u2022 Contrato CLT\n\u2022 VR (R$ 858,65 / m\u00eas);\n\u2022 VA (R$ 663,48 / m\u00eas);\n\u2022 Plano de Sa\u00fade;\n\u2022 Plano Odontol\u00f3gico;\n\u2022 PLR;\n\u2022 Vale Cesta de Natal Alelo;\n\u2022 Aux\u00edlio creche ou Bab\u00e1 (R$ 460,79 at\u00e9 6 anos);\n\u2022 Licen\u00e7a maternidade de 6 meses e paternidade de 20 dias;\n\u2022 Antecipa\u00e7\u00e3o do 13\u00ba no m\u00eas de maio.\n\nA Pottencial \u00e9 feita por pessoas para pessoas! E, n\u00f3s investimos em nossos #potters, porque acreditamos que a transforma\u00e7\u00e3o do mercado de seguros come\u00e7a na vontade de abra\u00e7ar os desafios di\u00e1rios e querer proporcionar tranquilidade para cada vez mais pessoas.\n\nNosso foco \u00e9 atrair talentos, sejam eles como forem! Abra\u00e7amos a diversidade e a inclus\u00e3o, incentivando que mulheres, pessoas com defici\u00eancia, diferentes ra\u00e7as e orienta\u00e7\u00f5es sexuais se candidatem \u00e0s nossas vagas e venham fazer parte da revolu\u00e7\u00e3o do mercado de seguros conosco. Afinal, olhares diversos encontram solu\u00e7\u00f5es mais rapidamente.\n\nNosso #TimeCampe\u00e3o respira trabalho em equipe, foco no resultado e transforma\u00e7\u00e3o digital, por isso, somos certificadas pela GPTW como uma excelente empresa para se trabalhar! E o resultado disso, \u00e9 que conquistamos a cinco anos consecutivos a lideran\u00e7a no mercado de Seguro Garantia e a vice-lideran\u00e7a do Seguro Fian\u00e7a Locat\u00edcia!\n\nEstamos sempre antenados aos movimentos do mercado, abra\u00e7ando, cada vez, mais a transforma\u00e7\u00e3o digital, as ideias inovadoras e os movimentos disruptivos.\n\nE a\u00ed, topa vir ser um #potter e revolucionar o mercado de seguros conosco",
