//       "description": "We Believe in Better!\n\nWe are a global information technology company that builds high-performance, security-centric solutions that can help change the world. Enhancing people\u2019s lives through secure, reliable advanced technology is our vision.\n\nAt Unisys, we believe in better! Here, you have the opportunity to learn new skills, apply your expertise, and solve complex problems with cutting edge technologies and solutions. You are part of a global diverse team that supports you, drives change, and delivers successful results consistently.\n\nOur associates are at the forefront of everything we do, driving our clients\u2019 successes while giving back to communities and making this world a safer and more secure place to live and work. Our success is a direct result of the work of our people who live and breathe our Core Beliefs. Simply put, we believe in better lives. Join us!\n\nLearn more about Unisys and our key solution offerings: Unisys, Stealth\u2122, CloudForte\u00ae, InteliServe\u2122\n\nObs: para a... cidade de S\u00e3o Paulo o modelo de trabalho ser\u00e1 H\u00edbrido, na regi\u00e3o da zona Sul.\n\nComo ser\u00e1 seu dia a dia\n\u2022 Contribuir com as evolu\u00e7\u00f5es na forma de trabalho, buscando abordagens modernas para garantir a qualidade de nossos produtos buscando evolu\u00e7\u00e3o constante;\n\u2022 Atuar na execu\u00e7\u00e3o de testes manuais e automatizados, valida\u00e7\u00f5es junto aos clientes para os m\u00f3dulos e servi\u00e7os que comp\u00f5em o ecossistema da nossa solu\u00e7\u00e3o. Estar sempre atento aos desafios da fun\u00e7\u00e3o e problemas de execu\u00e7\u00e3o e performance em geral. E buscando assegurar a continuidade das opera\u00e7\u00f5es e a melhor experi\u00eancia para o usu\u00e1rio;\n\u2022 Analisar os resultados dos testes manuais e automatizados;\n\u2022 Relatar bugs e melhorias para as equipes de desenvolvimento;\n\u2022 Trabalhar com equipes multidisciplinares para garantir a qualidade e seguran\u00e7a da informa\u00e7\u00e3o dos nossos produtos durante todo o ciclo de vida do desenvolvimento de Software;\n\u2022 Analisar relat\u00f3rios de vulnerabilidades para pesquisar, entender e relatar procedimentos de corre\u00e7\u00e3o;\n\u2022 Implantar e executar normas e procedimentos de seguran\u00e7a da informa\u00e7\u00e3o;\n\u2022 Garantir a evolu\u00e7\u00e3o e das ferramentas e plataformas de seguran\u00e7a adotadas;\n\u2022 Detec\u00e7\u00e3o de amea\u00e7as e vulnerabilidades em servi\u00e7os de TI que comprometam a informa\u00e7\u00e3o corporativa;\n\u2022 Identificar e definir os objetivos de prote\u00e7\u00e3o \u00e0 informa\u00e7\u00e3o;\n\u2022 Defini\u00e7\u00e3o, monitoramento e reporte de m\u00e9tricas de seguran\u00e7a da informa\u00e7\u00e3o;\n\u2022 Possuir capacidade de priorizar o seu pr\u00f3prio trabalho a partir das linhas gerais definidas pelo time e de feedbacks recebidos dos principais\n\nstakeholders.\n\nO que esperamos de voc\u00ea:\n\u2022 Gradua\u00e7\u00e3o em Ci\u00eancias da Computa\u00e7\u00e3o, An\u00e1lise de Sistemas, Sistemas de Informa\u00e7\u00e3o ou similar;\n\u2022 Experi\u00eancia na \u00e1rea de seguran\u00e7a da informa\u00e7\u00e3o, tendo como foco o penteste e analise de vulnerabilidades;\n\u2022 Possuir conhecimentos em seguran\u00e7a da informa\u00e7\u00e3o;\n\u2022 Boas no\u00e7\u00f5es acerca do funcionamento de aplica\u00e7\u00f5es Web;\n\u2022 Experi\u00eancia com gest\u00e3o e avalia\u00e7\u00e3o de vulnerabilidades;\n\u2022 Habilidade na realiza\u00e7\u00e3o de Pentest em aplica\u00e7\u00f5es Web;\n\nDesej\u00e1veis:\n\u2022 Conhecimento de normas e resolu\u00e7\u00f5es: ISO 270001 e 270002, BACEN-CMN #4658, LGPD;\n\u2022 OWASP;\n\u2022 Experi\u00eancia em equipes \u00e1geis (Scrum ou Kanban);\n\u2022 Possuir n\u00edvel de ingl\u00eas intermedi\u00e1rio;\n\u2022 Conhecimento em desenvolvimento de software seguro;\n\u2022 Conhecimento b\u00e1sico de ferramentas para Pentest Web (BurpSuite etc);\n\u2022 Conhecimento b\u00e1sico em Linguagens (Python, JavaScript, GO, Html);\n\u2022 Conhecimento b\u00e1sico em Firewall, Waf, Proxys e Redes",
