//       "description": "Ent\u00e3o voc\u00ea \u00e9 como a gente\n\nSomos uma empresa do setor de desenvolvimento urbano, imobili\u00e1rio residencial e comercial com forte atua\u00e7\u00e3o em S\u00e3o Paulo, Campinas e Rio de Janeiro. Em toda nossa trajet\u00f3ria, realizamos empreendimentos que fizeram hist\u00f3ria e transformaram regi\u00f5es, carregando uma preocupa\u00e7\u00e3o genu\u00edna com a qualidade de vida das cidades e das pessoas, traduzida em nossos programas de Gentilezas Urbanas e Gentilezas Humanas.\n\nUma empresa do Grupo Brookfield Asset Management, com 44 anos de atua\u00e7\u00e3o no mercado brasileiro e mais de 104 mil im\u00f3veis com alma constru\u00eddos, que totalizam mais de 25 milh\u00f5es de m2 finalizados e em constru\u00e7\u00e3o.\n\nNosso prop\u00f3sito \u00e9 criar empreendimentos com alma para que as pessoas possam viver melhor.\n\nConhe\u00e7a mais sobre a gente e venha fazer parte do Time Tegra.\n/n\n\u2022 Gradua\u00e7\u00e3o Completa em Ci\u00eancias da Computa\u00e7\u00e3o, An\u00e1lise e Desenvolvimento de Sistemas, Engenharia, Contabilidade e Administra\u00e7\u00e3o e/ou \u00c1reas correlatas;\n\u2022 Pacote Office Intermedi\u00e1rio/Avan\u00e7ado;\n\u2022... Conhecimento em Power BI e SQL;\n\u2022 Ter atuado com manipula\u00e7\u00e3o de dados.\n/n\n\u2022 Atualiza\u00e7\u00e3o de indicadores e pain\u00e9is demonstrativos, incluindo extra\u00e7\u00e3o de relat\u00f3rios em diversos sistemas;\n\u2022 Atuar junto aos analistas de canais de vendas para estrutura\u00e7\u00e3o de dashboards a serem divulgados de forma rotineira;\n\u2022 Desenvolver e acompanhar KPI's canais de vendas: (Visitas, Vendas, Share interno, Convers\u00e3o, Regionaliza\u00e7\u00e3o, Parceiros)- Criare atualizar materiais para apresenta\u00e7\u00e3o para Diretoria- Propor melhorias nos sistemas e portais legados, como objetivo de gerar conte\u00fados e informa\u00e7\u00f5es relevantes aos l\u00edderes de canais;\n\u2022 Fazer interface direta com Comercial e Marketing como objetivo de otimizar a divulga\u00e7\u00e3o de informa\u00e7\u00f5es;\n\u2022 Acompanhar melhorias de sistemas legados;\n\u2022 Participar na elabora\u00e7\u00e3o de proje\u00e7\u00f5es financeiras, assim como, acompanhar rotineiramente os gastos corporativos;\n\u2022 Criar an\u00e1lises de projetos e acompanhamento de resultados por unidade de neg\u00f3cio",
