//       "description": "VAGA PARA NOSSO BANCO DE TALENTOS\n\nProcuramos um Analista de BI (Web Analytics ) profissional dedicado a criar e a manter pipelines de dados que ir\u00e3o ser utilizados para responder perguntas de neg\u00f3cio, servir como origem de Dashboard Power BI e modelos de Machine Learning\n\nSomos inquietos, somos desbravadores e estamos em constante transforma\u00e7\u00e3o.\n\nPor isso, estamos na busca constante de crescimentos do nosso time com profissionais inovadores, que desafiam os limites e estejam preparados para embarcar em uma cultura totalmente n\u00f4made.\n\nSOMOS N\u00d4MADES, NOSSAS VAGAS S\u00c3O PARA QUALQUER LUGAR!\n\nSeja qual for o seu g\u00eanero, orienta\u00e7\u00e3o sexual, idade, ra\u00e7a, etnia, cren\u00e7a ou defici\u00eancia, todos s\u00e3o bem-vindos no nosso time.\n\nResponsabilidades e atribui\u00e7\u00f5es\n\u2022 Planejar, projetar e implementar an\u00e1lises de dados em um portf\u00f3lio de canais e plataformas digitais;\n\u2022 An\u00e1lise e interpreta\u00e7\u00e3o de resultados (de m\u00eddia), buscando otimiza\u00e7\u00f5es e inova\u00e7\u00f5es;\n\u2022 Aux\u00edlio no planejamento e valida\u00e7\u00e3o de experimentos de... otimiza\u00e7\u00e3o de convers\u00e3o;\n\u2022 Obter insights por meio de dados e testes para definir KPIs e acompanhar/direcionar campanhas digitais;\n\u2022 Estabelecer processo padr\u00e3o para as propriedades digitais do cliente para configurar, manter e rastrear dados de alcance, engajamento, desempenho e outras m\u00e9tricas de comportamento;\n\u2022 Implementa\u00e7\u00e3o de analytics incluindo propriedades, gerenciamento de usu\u00e1rios, pain\u00e9is e relat\u00f3rios;\n\u2022 Trabalhar com desenvolvedores para determinar m\u00e9tricas e comportamento apropriados para rastrear propriedades novas e existentes;\n\u2022 Elabora\u00e7\u00e3o e apresenta\u00e7\u00e3o de relat\u00f3rios;\n\nRequisitos e qualifica\u00e7\u00f5es\n\u2022 Conhecimento avan\u00e7ado de Google Analytics;\n\u2022 Conhecimento avan\u00e7ado de GTM;\n\u2022 Conhecimento em an\u00e1lise de dados de performance em redes sociais;\n\u2022 Experi\u00eancia com implementa\u00e7\u00e3o de traking e tags de m\u00eddia;\n\u2022 Experi\u00eancia com Adobe Analytics (diferencial);\n\u2022 Experi\u00eancia com Power BI e Google Data Studio (diferencial);\n\u2022 Experi\u00eancia com automa\u00e7\u00e3o via Supermetrics (diferencial);\n\nInforma\u00e7\u00f5es adicionais\n\nOs desbravadores tem:\n\u2022 Hor\u00e1rio flex\u00edvel, aqui voc\u00ea \u00e9 respons\u00e1vel por se organizar;\n\u2022 Cultura \u00e1gil, aqui todos os desbravadores utilizam metodologias \u00e1geis no dia a dia;\n\u2022 No dress code, seja 100% voc\u00ea;\n\u2022 Vale transporte;\n\u2022 Vale refei\u00e7\u00e3o ou alimenta\u00e7\u00e3o FLEX;\n\u2022 Plano odontol\u00f3gico Bradesco;\n\u2022 Plano de sa\u00fade Bradesco;\n\u2022 Seguro de vida Metlife;\n\u2022 Bem estar psicol\u00f3gico gratuito;\n\u2022 Brivia Academy, treinamentos para aperfei\u00e7oamento;\n\u2022 Aux\u00edlio em cursos qualifica\u00e7\u00e3o profissional;\n\u2022 B\u00f4nus salarial;\n\u2022 Programa de desenvolvimento de idiomas;\n\u2022 Parceria e descontos em Universidades;\n\u2022 Associa\u00e7\u00e3o e descontos na ABRADI;\n\u2022 E o melhor de todos: trabalhe de onde voc\u00ea quiser, somos n\u00f4mades e estamos 100% em home office!\n\nEstamos entre as melhores ag\u00eancias para se trabalhar no Brasil!\n\nNa Brivia, voc\u00ea precisa estar com a mente e o passaporte sempre abertos. Afinal, n\u00f3s vamos onde nossos clientes, seus problemas e nossas solu\u00e7\u00f5es nos levam.\n\nSim, temos sedes no Brasil, na America Latina e na Europa, mas acreditamos no trabalho remoto. Temos b.a.s.e em 4 estados brasileiros, mas com profissionais espalhados por mais de 10 estados. Possu\u00edmos um escrit\u00f3rio estrat\u00e9gico em Lisboa, Portugal, al\u00e9m de escrit\u00f3rios no Chile, Argentina e Col\u00f4mbia. Mas n\u00e3o temos ende